import React, { useContext } from 'react';
import styles from '../../styles/components/admin_navbar.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import NewProject from '../modals/NewProjects';

import { AuthActions } from '../../context/contexts/auth.context';

import useToggle from '../../hooks/useToggle';

import DashboardButton from '../layout/DashboardButton';

const AdminNavbar = () => {
	const { logout } = useContext(AuthActions);
	const [ newProject, toggleNewProject ] = useToggle(false);

	return (
		<nav className={styles.navbar}>
			<div className={styles.navbar__header}>
				<h4 className={styles.navbar__header__title}>Dashboard</h4>
			</div>
			<div className={styles.navbar__controls}>
				<DashboardButton style="large">
					<FontAwesomeIcon icon="home" />
				</DashboardButton>
				<DashboardButton style="large" onClick={toggleNewProject}>
					<svg width="30px" height="30px" viewBox="0 0 220 149" fill="none" xmlns="http://www.w3.org/2000/svg">
						<path
							d="M0 123H220V139C220 144.523 215.523 149 210 149H10C4.47716 149 0 144.523 0 139V123Z"
							fill="white"
						/>
						<path
							fill-rule="evenodd"
							clip-rule="evenodd"
							d="M0 10C0 4.47715 4.47715 0 10 0H210C215.523 0 220 4.47715 220 10V100H0V10ZM100 69.1292L60 39L10 69V89H210V49L160 19L100 69.1292ZM36 28C38.2091 28 40 26.2091 40 24C40 21.7909 38.2091 20 36 20H29V13C29 10.7909 27.2091 9 25 9C22.7909 9 21 10.7909 21 13V20H14C11.7909 20 10 21.7909 10 24C10 26.2091 11.7909 28 14 28H21V35C21 37.2091 22.7909 39 25 39C27.2091 39 29 37.2091 29 35V28H36ZM100 49C108.284 49 115 42.2843 115 34C115 25.7157 108.284 19 100 19C91.7157 19 85 25.7157 85 34C85 42.2843 91.7157 49 100 49Z"
							fill="white"
						/>
					</svg>
				</DashboardButton>
				<DashboardButton style="large">
					<FontAwesomeIcon icon="cog" />
				</DashboardButton>
				<DashboardButton onClick={logout} style="large">
					<FontAwesomeIcon icon="sign-out-alt" />
				</DashboardButton>
				<NewProject show={newProject} toggle={toggleNewProject} />
			</div>
		</nav>
	);
};

export default AdminNavbar;
